                while (1) {
                    dbFlag = 0;
                    console.log(fnname + ': para.nStep = ' + para.nStep);
                    switch (para.nStep) {
                        case 0:
                        case 'isApply':
                            this.openId = openId;

                            tableName = this.mac.tb.customer;
                            dbData = {};
                            dbData[that.mac.fd.id] = [1];
                            dbData[that.mac.fd.customer.name] = [];
                            dbData[that.mac.fd.customer.mobile] = [];
                            dbData[that.mac.fd.customer.status] = [];

                            that.sys.recordRead_(tableName, dbData, function () {
                                if (dbData[that.mac.fd.id].length > 0) {
                                    that.applyStatus = dbData[that.mac.fd.customer.status][0];
                                }

                                para.nStep = 'subModuleStart';
                                if (++dbFlag === 2) {
                                    that.startModule(openId, successCallBack, errorCallBack)
                                }
                            }, para.errorCallBack);
                            break;
                        case 'subModuleStart':
                            if (para.i >= arrRef.length) {
                                para.i = 0;
                                para.nStep = 'showSubModule';
                                dbFlag++;
                                break;
                            }

                            that.sm[arrRef[para.i]].startModule(function () {
                                para.i++;
                                para.nStep = 'subModuleStart';
                                if (++dbFlag === 2) {
                                    that.startModule(openId, successCallBack, errorCallBack)
                                }
                            }, para.errorCallBack);
                            break;
                        case 'showSubModule':
                            that.showSubModule(arrRef, true, function () {
                                para.nStep = 'end';
                                if (++dbFlag === 2) {
                                    that.startModule(openId, successCallBack, errorCallBack)
                                }
                            }, para.errorCallBack);
                            break;
                        case 'end':
                            para.successCallBack();
                            return
                    }
                    if (++dbFlag === 1) {
                        return
                    }
                }
            },

            openApplyInput: function () {
                let that = this;

                if (this.applyStatus === that.mac.enum.customer.status.pending) {
                    this.$notify({type: 'warning', message: '您的报名申请正在审核中！'});
                    return
                } else if (this.applyStatus === that.mac.enum.customer.status.approved) {
                    this.$notify({type: 'warning', message: '您已报名成功，请勿重复报名！'});
                    return
                }

                that.showSubModule('applyInputRef', true, function () {
                    that.sm.applyInputRef.openId = that.openId;
                    that.sm.applyInputRef.startModule(function () {
                    }, function () {
                    });
                }, function () {
                });
            },

            openMap: function () {
                let that = this;
                that.showSubModule('mapRef', true, function () {
                    let address = {
                        lng: "113.904905",
                        lat: "22.568754",
                        province: "广东省",
                        city: "深圳市",
                        district: "宝安区",
                        address: "万悦格兰云天大酒店2楼3号会议厅",
                    };

                    that.sm.mapRef.startModule(address, function (result) {
                        console.log(result);
                    }, function (error) {
                        console.error(error);
                    });
                }, function () {
                });
            },

            placeRef_textClickEvent: function () {
                this.openMap();
            },
            mapBtnRef_textClickEvent: function () {
                this.openMap();
            },
            applyBtnRef_buttonClickEvent: function () {
                this.openApplyInput();
            },
            toTopRef_textClickEvent: function () {
                this.toTop();
            },
            applyInputRef_register: function (customerInfo, successCallBack, errorCallBack) {
                this.ep.register(customerInfo, successCallBack, errorCallBack);
            },
        },
    };
